import React from "react";
import classes from "MainNavigatoin.module.css";

function MainNavigation() {
  return (
    <header className="classes.header">
      <div>
        <nav>
          <ul>
            <li> Quote</li>
            <li> QuoteDetail</li>
            <li> QuoteSample</li>
          </ul>
        </nav>
      </div>
    </header>
  );
}

export default MainNavigation;
